// components/NavBar.tsx
// components/ShadeNavbar.tsx
import React from 'react';

const Navbar = () => {
  return (
    <nav class="shade-nav">
      <ul>
        <li><a href="#">Home</a></li>
        <li><a href="#">About Us</a></li>
        <li><a href="#">Policies</a></li>
        <li><a href="#">Contact Us</a></li>
      </ul>
    </nav>
  );
};

export default Navbar;
